import { Card } from "antd";
import React from "react";

const PostCard = ({ post }) => {
  return (
    <div>
      <Card cover={post.images[0]}>
        <Image />
        <Content />
        <Button></Button>
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
